// main_heading.js

import React from "react";
import { Heading, Divider } from "@chakra-ui/react";

function MainHeading() {
  return (
    <div>
      <Heading as="h1" size="xl" ml={4}> {/* Add ml prop for left padding */}
        GitHub Repo Searcher
      </Heading>
      <Divider my={4} />
    </div>
  );
}

export default MainHeading;
